import React from 'react';
import { Link } from 'react-router-dom';
import Logo from '../assets/images/Logo.png';

const Navbar = () => (
  <nav className="flex flex-wrap justify-between items-center px-6 py-4 sm:px-10">
    {/* Logo */}
    <Link to="/" className="flex items-center">
      <img src={Logo} alt="Logo" className="w-12 h-12" />
      <span className="ml-3 text-xl font-bold text-blue-600 hidden sm:inline">Fitness Club</span>
    </Link>

    {/* Nav Links */}
    <div className="flex gap-6 text-lg font-medium items-end font-serif">
      <Link
        to="/"
        className="text-gray-800 hover:text-blue-600 border-b-2 border-blue-600 transition-all duration-300"
      >
        Home
      </Link>
      <a
        href="#exercises"
        className="text-gray-800 hover:text-blue-600 transition-colors duration-300"
      >
        Exercises
      </a>
    </div>
  </nav>
);

export default Navbar;
